        /*POSITIONING II*/

        /*div {
            border: 1px solid black;
        }*/

        .row {
            clear: both;
            width: 100%;
        }


        .align-left {
            float: left;
            display: block;            
        }

        .align-right {
            float: right;
            display: block;
        }

        .ghost-center {
            position: relative;
        }

        .ghost-center::before {
            content: " ";
            display: inline-block;
            height: 100%;
            width: 1%;
            vertical-align: middle;
        }

        .ghost-center p {
            display: inline-block;
            vertical-align: middle;
        }


        .block-horizontal-center {
            margin: 0 auto;
        }

        .inline-block-center div {
            display: inline-block;
            text-align: center;
        }

        .inline-block-center {
            text-align: center;
        }

        .text-block-center {
            text-align: center;
        }

        .vertical-space-small {
            padding-top: 0.5cm;
        }

        .vertical-space-medium {
            padding-top: 1cm;
        }

        .vertical-space-large {
            padding-top: 1.5cm;
        }

        .vertical-space-larger {
            padding-top: 2cm;
        }

        
        .item-centered {
            opacity: 0.8;
            font-size: 1.2em;
            padding: 0.5em;
            text-align: center;
            margin-left: auto;
            margin-right: auto;
        }


        /*elements*/
        .isin {
            text-align: center;
            font-family: 'PT Sans Narrow';
            font-weight: 200;
            font-size:large;
            margin-bottom: auto;
            margin-top: auto;
        }

        .date {
            font-family: 'Didact Gothic';
            font-size: large;
            font-weight: 500;
            opacity: 0.8;
        }

        .load {
            font-family: 'Didact Gothic';
            font-size: large;
            font-weight: 500;
            opacity: 0.8;
        }

        .load2 {
            font-family: 'Didact Gothic';
            font-size: large;
            font-weight: 500;
            opacity: 0.8;
        }

        .issuer {
            font-family: 'Arimo';
            font-size: xx-large;
            font-weight: 900;
        }

        .product-name {
            font-family: 'Roboto';
            font-size: x-large;
            font-weight: 700;
        }

        .text {
            font-family: 'Didact Gothic';
            font-size: large;
            font-weight: 400;
        }

        .untershift {
            border-top: dotted black thin;
            -moz-border-top-colors: black;
            font-family: 'Didact Gothic';
            font-size: medium;
            font-weight: 400;
            width: 60%;
            text-align: center;
            margin-left: auto;
            margin-right: auto;
        }
        

    </style>
